sys_variable_value.value:
(function execute(inputs, outputs) {

var response = JSON.parse(inputs.Responsebody);
outputs.statuscode = inputs.statuscode
if(inputs.statuscode == 201)
{
outputs.message = "Pull request #"+response.number+"created successfully";
outputs.pullnumber = response.number;
}
else {
outputs.message = inputs.errormessage;
}

})(inputs, outputs);

